import { sql } from "@vercel/postgres";

export default async function User(req, res) {
  try {
    const { rows } = await sql`SELECT * from users`;
    console.log(rows);
    res.status(200).end();
  } catch (error) {
    console.error(error);
    res.status(500).end();
  }
}
